import React, { Component } from 'react';
import ButtonArticle from './ButtonArcticle';
import {Card as BootstrapCard, Button, Col} from 'react-bootstrap'
class Card extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }

    render() { 
        return (
            <Col className="justify-content-md-center" lg={4} md={12} mb={12}>
                <BootstrapCard className="h-100" style={{ width: '14rem' }}>
                    <BootstrapCard.Img variant="top" src={this.props.article.cover} />
                    <BootstrapCard.Body>
                        <BootstrapCard.Title>BootstrapCard Title</BootstrapCard.Title>
                        <BootstrapCard.Text>
                        Some quick example text to build on the Bootstrapcard title and make up the bulk of
                        the Bootstrapcard's content.
                        </BootstrapCard.Text>
                        <Button variant="primary">Go somewhere</Button>
                    </BootstrapCard.Body>
                    <BootstrapCard.Footer></BootstrapCard.Footer>
                </BootstrapCard>

            </Col>
        )
     }
}
 
export default Card;
